// src/components/GamePage.js
import React from 'react';

const GamePage = ({ onStartGame }) => {
  return (
    <div>
      <h1>Typing Sprint</h1>
      <button onClick={onStartGame}>Start Game</button>
    </div>
  );
}

export default GamePage;
